import React from 'react';
import { Menu } from 'antd';
import { FileOutlined, SaveOutlined, EyeOutlined, UndoOutlined, RedoOutlined } from '@ant-design/icons';

const TopMenu: React.FC = () => {
  return (
    <Menu mode="horizontal" theme="light">
      <Menu.SubMenu key="file" icon={<FileOutlined />} title="文件">
        <Menu.Item key="new">新建</Menu.Item>
        <Menu.Item key="open">打开</Menu.Item>
        <Menu.Item key="save" icon={<SaveOutlined />}>保存</Menu.Item>
      </Menu.SubMenu>
      <Menu.Item key="preview" icon={<EyeOutlined />}>
        预览
      </Menu.Item>
      <Menu.Item key="undo" icon={<UndoOutlined />}>
        撤销
      </Menu.Item>
      <Menu.Item key="redo" icon={<RedoOutlined />}>
        重做
      </Menu.Item>
    </Menu>
  );
};

export default TopMenu;
